package StaticKeywordMethods;

public class classD {
static int x=10;
	public static void main(String[] args) {
		// TODO Auto-generated method stub
         classD t1 = new classD();
         classD t2 = new classD();
         t1.x = 20;
         System.out.print(x + " ");
         System.out.println(t2.x);
         
	}

}
